import React from "react";
import "./HeaderBar.css";

const HeaderBar = () => {
  return (
    <div className="container">
      <center>
        <span
          style={{
            fontSize: 60,
          }}
        >
          EricAuction
        </span>
      </center>
    </div>
  );
};

export default HeaderBar;
